import React from 'react'
import {Wrapper} from '../Styled'
import styled from 'styled-components'
import MinimalIcon from '@material-ui/icons/FiberManualRecord';
import MobileIcon from '@material-ui/icons/PhoneIphone';
import ComponentIcon from '@material-ui/icons/Cached';


const CardContainer = styled(Wrapper)`
    width: 100%;
    display:flex;
    flex-direction:row;
    background: linear-gradient(#e66465, #9198e5);
`

const ToolCard = styled.div`
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:space-around;
    height:25em;
    width:20em;
    border: 10px solid var(--s-3);
` 

export default function Tools() {
    return (
        <CardContainer>
            <ToolCard>
                <MinimalIcon/>
                AWS
            </ToolCard>
            <ToolCard>
                <MobileIcon/>
                React
            </ToolCard>
            <ToolCard>
                <ComponentIcon/>
                Wordpress
            </ToolCard>
        </CardContainer>
    )
}
